import React from 'react';
export default function Filter()
{
    const [opened,setOpened] = React.useState(false)
    function changeOpened()
    {
        setOpened(prevState => !prevState)
    }
    if(opened==false)
    return(
        <div className="filter-closed">
             <img src="https://cdn-icons.flaticon.com/png/128/2516/premium/2516722.png?token=exp=1652817675~hmac=e3b181bc009a2ac0e711c3e5ecb85679"
              alt="" className="filter-img"/>
             <h3 className='h3-filter'>FILTERS</h3>
        </div>
    )
    else
    return(
        <div className="filter-opened">
             <input className="spot-input" placeholder="Country" type="text" />
             <input className="spot-input" placeholder="Wind Probability" type="text" name="country" />
             <button className='spot-button'>APPLY FILTER</button>
        </div>
    )
}
